import React from 'react'
import logoIcon from './images/logo-icon.png'
import lightLogo from './images/logo-light-text.png'
import lightIcon from './images/logo-light-icon.png'
import user from './images/orgxtopaz.png'
import './css/custom.css';

function Inbox() {
  return (


    <div>
    {/* ============================================================== */}
    {/* Preloader - style you can find in spinners.css */}
    {/* ============================================================== */}
    <div className="preloader">
      <div className="lds-ripple">
        <div className="lds-pos" />
        <div className="lds-pos" />
      </div>
    </div>
    {/* ============================================================== */}
    {/* Main wrapper - style you can find in pages.scss */}
    {/* ============================================================== */}
    <div id="main-wrapper" data-layout="vertical" data-navbarbg="skin5" data-sidebartype="full" data-sidebar-position="absolute" data-header-position="absolute" data-boxed-layout="full">
      {/* ============================================================== */}
      {/* Topbar header - style you can find in pages.scss */}
      {/* ============================================================== */}
      <header className="topbar" data-navbarbg="skin5">
        <nav className="navbar top-navbar navbar-expand-md navbar-dark">
          <div className="navbar-header" data-logobg="skin5">
            {/* ============================================================== */}
            {/* Logo */}
            {/* ============================================================== */}
            <a className="navbar-brand" href="/">
              {/* Logo icon */}
              <b className="logo-icon">
                {/* Dark Logo icon */}
                <img src="https://i.scdn.co/image/ab6761610000e5ebc02d416c309a68b04dc94576" alt="homepage" className="dark-logo" />
                {/* Light Logo icon */}
                <img src={lightIcon} alt="homepage" className="light-logo" />
              </b>
              {/*End Logo icon */}
              {/* Logo text */}
              <span className="logo-text">
                {/* dark Logo text */}
                <img src={logoIcon}alt="homepage" className="dark-logo" />
                {/* Light Logo text */}
                {/* <img src={lightLogo} className="light-logo" alt="homepage" /> */}
              </span>
            </a>
            {/* ============================================================== */}
            {/* End Logo */}
            {/* ============================================================== */}
            {/* This is for the sidebar toggle which is visible on mobile only */}
            <a className="nav-toggler waves-effect waves-light d-block d-md-none" href="javascript:void(0)"><i className="ti-menu ti-close" /></a>
          </div>
          {/* ============================================================== */}
          {/* End Logo */}
          {/* ============================================================== */}
          <div className="navbar-collapse collapse" id="navbarSupportedContent" data-navbarbg="skin5">
            {/* ============================================================== */}
            {/* toggle and nav items */}
            {/* ============================================================== */}
          
            {/* ============================================================== */}
            {/* Right side toggle and nav items */}
            {/* ============================================================== */}
           
          </div>
        </nav>
      </header>
      {/* ============================================================== */}
      {/* End Topbar header */}
      {/* ============================================================== */}
      {/* ============================================================== */}
      {/* Left Sidebar - style you can find in sidebar.scss  */}
      {/* ============================================================== */}
      <aside className="left-sidebar" data-sidebarbg="skin6">
        {/* Sidebar scroll*/}
        <div className="scroll-sidebar">
          {/* Sidebar navigation*/}
          <nav className="sidebar-nav">
            <ul id="sidebarnav">
              {/* User Profile*/}
              <li>
                {/* User Profile*/}
                <div className="user-profile d-flex no-block dropdown m-t-20">
                  <div className="user-pic"><img src={user} alt="users" className="rounded-circle" width={40} /></div>
                  <div className="user-content hide-menu m-l-10">
                    <a href="#" className id="Userdd" role="button" data-bs-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                      <h5 className="m-b-0 user-name font-medium">Orgxtopaz <i className="fa fa-angle-down" /></h5>
                      <span className="op-5 user-email">orgxtopaz@gmail.com</span>
                    </a>
                    <div className="dropdown-menu dropdown-menu-end" aria-labelledby="Userdd">
                      <a className="dropdown-item" href="/adminProfile"><i className="ti-user m-r-5 m-l-5" /> My Profile</a>
                      <a className="dropdown-item" href="javascript:void(0)"><i className="ti-email m-r-5 m-l-5" /> Inbox</a>
                      
                      <a className="dropdown-item" href="javascript:void(0)"><i className="fa fa-power-off m-r-5 m-l-5" /> Logout</a>
                    </div>
                  </div>
                </div>
                {/* End User Profile*/}
              </li>
      
              {/* User Profile*/}
              <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="/adminHome" aria-expanded="false"><i className="mdi mdi-view-dashboard" /><span className="hide-menu">Dashboard</span></a></li>
              <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="/adminProfile" aria-expanded="false"><i className="mdi mdi-account-network" /><span className="hide-menu">Profile</span></a></li>
              <li className="sidebar-item"> <a className="sidebar-link waves-effect waves-dark sidebar-link" href="/seeRequests" aria-expanded="false"><i className="mdi mdi-border-all" /><span className="hide-menu">Customer's Requests</span></a></li>

           
            </ul>
          </nav>
          {/* End Sidebar navigation */}
        </div>
        {/* End Sidebar scroll*/}
      </aside>




      <center>
      <div className="container mt-5" >
        <div className="row d-flex justify-content-center">
          <div className="col-md-8" style={{    marginRight: "-10%"}}>
            <div className="headings d-flex justify-content-between align-items-center mb-3">
              <h5>Unread Messages(3)</h5>
              <div className="buttons"> <span className="badge bg-white d-flex flex-row align-items-center"> <span className="text-primary">Delete All </span>
                  <div className="form-check form-switch"> <input className="form-check-input" type="checkbox" id="flexSwitchCheckChecked"  /> </div>
                </span> </div>
            </div>
            <div className="card p-3">
              <div className="d-flex justify-content-between align-items-center">
                <div className="user d-flex flex-row align-items-center"> <img src="https://i.imgur.com/hczKIze.jpg" width={30} className="user-img rounded-circle mr-2" /> <span><small className="font-weight-bold text-primary"> james_olesenn</small> <small className="font-weight-bold">Hmm, Your latest post is good</small></span> </div> <small>2 days ago</small>
              </div>
              <div className="action d-flex justify-content-between mt-2 align-items-center">
                <div className="reply px-4"> <small>Remove</small> <span className="dots" /> <small>Reply</small> <span className="dots" />  </div>
                <div className="icons align-items-center"> <i className="fa fa-star text-warning" /> <i className="fa fa-check-circle-o check-icon" /> </div>
              </div>
            </div>
            <div className="card p-3 mt-2">
              <div className="d-flex justify-content-between align-items-center">
                <div className="user d-flex flex-row align-items-center"> <img src="https://i.imgur.com/C4egmYM.jpg" width={30} className="user-img rounded-circle mr-2" /> <span className="mr-4"><small className="font-weight-bold text-primary ">olan_sams</small> <small className="font-weight-bold">Thank you admin </small></span> </div> <small>3 days ago</small>
              </div>
              <div className="action d-flex justify-content-between mt-2 align-items-center">
                <div className="reply px-4"> <small>Remove</small> <span className="dots" /> <small>Reply</small> <span className="dots" />  </div>
                <div className="icons align-items-center"> <i className="fa fa-check-circle-o check-icon text-primary" /> </div>
              </div>
            </div>
          
            <div className="card p-3 mt-2">
              <div className="d-flex justify-content-between align-items-center">
                <div className="user d-flex flex-row align-items-center"> <img src="https://i.imgur.com/ZSkeqnd.jpg" width={30}  /> <span><small className="font-weight-bold text-primary">simona_rnasi</small> <small className="font-weight-bold">Thanks </small></span> </div> <small>3 days ago</small>
              </div>
              <div className="action d-flex justify-content-between mt-2 align-items-center">
                <div className="reply px-4"> <small>Remove</small> <span className="dots" /> <small>Reply</small> <span className="dots" /> </div>
                <div className="icons align-items-center"> <i className="fa fa-check-circle-o check-icon text-primary" /> </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      </center>
      </div>














     
{/* ============================================================== */}
{/* End Container fluid  */}
{/* ============================================================== */}
{/* ============================================================== */}
{/* footer */}
{/* ============================================================== */}
<footer className="footer text-center">
          All Rights Reserved by Orgxtopaz. Designed and Developed by <a href="https://www.fiverr.com/orgxtopaz">Orgxtopaz</a>.
        </footer>
{/* ============================================================== */}
{/* End footer */}
{/* ============================================================== */}
</div>
 
  
   
    
  )
}

export default Inbox
